0441\u0442\u044c\u044f\u043d \u041f\u043e\u043c\u0431\u0430\u043b<\/a> \u043e\u0431\u0443\u0437\u0434\u0430\u043b \u0432\u043b\u0430\u0441\u0442\u044c \u0438\u043d\u043a\u0432\u0438\u0437\u0438\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438<\/a>, \u0438\u0437\u0434\u0430\u0432 \u0443\u043a\u0430\u0437, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0430\u0443\u0442\u043e\u0434\u0430\u0444\u0435 \u043d\u0435 \u0434\u043e\u043b\u0436\u043d\u043e \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442\u044c \u0431\u0435\u0437 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043e\u0434\u043e\u0431\u0440\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1762_%D0%B3%D0%BE%D0%B4\" title=\"1762 \u0433\u043e\u0434\">1762<\/a>&#160;\u2014 \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1762)\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1762)\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1764_%D0%B3%D0%BE%D0%B4\" title=\"1764 \u0433\u043e\u0434\">1764<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u043e \u0443\u043a\u0430\u0437\u0443 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b II<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u0412\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u0431\u043b\u0430\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0445 \u0434\u0435\u0432\u0438\u0446 \u0438 \u043f\u0440\u0438 \u043d\u0451\u043c \u0443\u0447\u0438\u043b\u0438\u0449\u0435 \u0434\u043b\u044f \u043c\u0435\u0449\u0430\u043d\u0441\u043a\u0438\u0445 \u0434\u0435\u0432\u0443\u0448\u0435\u043a (\u0421\u043c\u043e\u043b\u044c\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442)&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0436\u0435\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e-\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1788_%D0%B3%D0%BE%D0%B4\" title=\"1788 \u0433\u043e\u0434\">1788<\/a>&#160;\u2014 \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c \u041c\u0430\u0440\u0442\u0438\u043d\u0435\u0441 (Esteb\u00e0n Jos\u00e9 Martinez) \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e\u0441\u0442\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440<\/a> (\u043d\u044b\u043d\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a>) \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XVI\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI<\/a> \u0441\u043e\u0437\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D1%88%D1%82%D0%B0%D1%82%D1%8B_(%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0448\u0442\u0430\u0442\u044b (\u0424\u0440\u0430\u043d\u0446\u0438\u044f)\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0448\u0442\u0430\u0442\u044b<\/a>, \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441 1614 \u0433\u043e\u0434\u0430. \u041d\u0435\u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438\u0439\u0442\u0438 \u043a \u043a\u043e\u043c\u043f\u0440\u043e\u043c\u0438\u0441\u0441\u0443 \u0432 \u0445\u043e\u0434\u0435 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0439, \u0441\u0442\u0430\u043b\u0438 \u0442\u043e\u043b\u0447\u043a\u043e\u043c \u0434\u043b\u044f \u0441\u043e\u0431\u044b\u0442\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1816_%D0%B3%D0%BE%D0%B4\" title=\"1816 \u0433\u043e\u0434\">1816<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_(%D0%B2%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%A1%D0%B0%D0%BA%D1%81%D0%B5%D0%BD-%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80-%D0%AD%D0%B9%D0%B7%D0%B5%D0%BD%D0%B0%D1%85%D1%81%D0%BA%D0%B8%D0%B9)\" title=\"\u041a\u0430\u0440\u043b \u0410\u0432\u0433\u0443\u0441\u0442 (\u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u0433\u0435\u0440\u0446\u043e\u0433 \u0421\u0430\u043a\u0441\u0435\u043d-\u0412\u0435\u0439\u043c\u0430\u0440-\u042d\u0439\u0437\u0435\u043d\u0430\u0445\u0441\u043a\u0438\u0439)\">\u041a\u0430\u0440\u043b \u0410\u0432\u0433\u0443\u0441\u0442 \u0421\u0430\u043a\u0441\u0435\u043d-\u0412\u0435\u0439\u043c\u0430\u0440-\u042d\u0439\u0437\u0435\u043d\u0430\u0445\u0441\u043a\u0438\u0439<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b \u043f\u0435\u0440\u0432\u0443\u044e \u043d\u0435\u043c\u0435\u0446\u043a\u0443\u044e \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e.<\/li><li>\u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u043e\u043d\u0435\u0442 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u044d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D1%81,_%D0%94%D0%B6%D0%BE%D0%BD\" title=\"\u041a\u0438\u0442\u0441, \u0414\u0436\u043e\u043d\">\u0414\u0436\u043e\u043d\u0430 \u041a\u0438\u0442\u0441\u0430<\/a> (John Keats).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821_%D0%B3%D0%BE%D0%B4\" title=\"1821 \u0433\u043e\u0434\">1821<\/a>&#160;\u2014 \u0441\u043c\u0435\u0440\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 I<\/a> \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%95%D0%BB%D0%B5%D0%BD%D1%8B\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b\">\u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u0430 \u0432 \u0441\u0442\u0440\u043e\u0439 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u0415\u0432\u0440\u043e\u043f\u0435 \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430. \u041e\u043d\u0430 \u0441\u0432\u044f\u0437\u0430\u043b\u0430 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%85%D0%B5%D0%BB%D0%B5%D0%BD\" title=\"\u041c\u0435\u0445\u0435\u043b\u0435\u043d\">\u041c\u0435\u0445\u0435\u043b\u0435\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%8E%D1%81%D1%81%D0%B5%D0%BB%D1%8C\" title=\"\u0411\u0440\u044e\u0441\u0441\u0435\u043b\u044c\">\u0411\u0440\u044e\u0441\u0441\u0435\u043b\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842_%D0%B3%D0%BE%D0%B4\" title=\"1842 \u0433\u043e\u0434\">1842<\/a>&#160;\u2014 \u0413\u0440\u043e\u0431 \u0441 \u0442\u0435\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%80%D0%BC%D0%BE%D0%BD%D1%82%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0435\u0440\u043c\u043e\u043d\u0442\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u042e\u0440\u044c\u0435\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u042e\u0440\u044c\u0435\u0432\u0438\u0447\u0430 \u041b\u0435\u0440\u043c\u043e\u043d\u0442\u043e\u0432\u0430<\/a> \u043f\u0435\u0440\u0435\u0432\u0435\u0437\u0451\u043d \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%8F%D1%82%D0%B8%D0%B3%D0%BE%D1%80%D1%81%D0%BA\" title=\"\u041f\u044f\u0442\u0438\u0433\u043e\u0440\u0441\u043a\">\u041f\u044f\u0442\u0438\u0433\u043e\u0440\u0441\u043a\u0430<\/a> \u0432 \u0422\u0430\u0440\u0445\u0430\u043d\u044b \u0432 \u0441\u0435\u043c\u0435\u0439\u043d\u044b\u0439 \u0441\u043a\u043b\u0435\u043f \u0410\u0440\u0441\u0435\u043d\u044c\u0435\u0432\u044b\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%81%D1%82%D0%BE%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u043e\u0441\u0442\u043e\u0435\u0432\u0441\u043a\u0438\u0439, \u0424\u0451\u0434\u043e\u0440 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0424\u0451\u0434\u043e\u0440 \u0414\u043e\u0441\u0442\u043e\u0435\u0432\u0441\u043a\u0438\u0439<\/a> \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u0447\u043b\u0435\u043d\u0430\u043c\u0438 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043a\u0440\u0443\u0436\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%B0%D1%88%D0%B5%D0%B2%D1%86%D1%8B\" title=\"\u041f\u0435\u0442\u0440\u0430\u0448\u0435\u0432\u0446\u044b\">\u043f\u0435\u0442\u0440\u0430\u0448\u0435\u0432\u0446\u0435\u0432<\/a> \u043f\u043e \u0434\u043e\u043d\u043e\u0441\u0443 \u043f\u0440\u043e\u0432\u043e\u043a\u0430\u0442\u043e\u0440\u0430 \u0410\u043d\u0442\u043e\u043d\u0435\u043b\u043b\u0438 \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u0438 \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d \u0432 \u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0443\u044e \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c. \u041f\u043e\u0437\u0436\u0435 \u0431\u044b\u043b \u0432\u044b\u043d\u0435\u0441\u0435\u043d 21 \u0441\u043c\u0435\u0440\u0442\u043d\u044b\u0439 \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440 (\u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0438 \u0424.&#160;\u041c.&#160;\u0414\u043e\u0441\u0442\u043e\u0435\u0432\u0441\u043a\u043e\u043c\u0443, \u043d\u043e \u043f\u0435\u0440\u0435\u0434 \u0441\u0430\u043c\u044b\u043c \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u0438\u0435\u043c \u043e\u043d \u0431\u044b\u043b \u0437\u0430\u043c\u0435\u043d\u0451\u043d \u0441\u0441\u044b\u043b\u043a\u043e\u0439).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D1%84%D1%80%D0%B0%D0%BD%D0%BA%D0%BE-%D0%B8%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%B2%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_%D0%B2_%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D1%83\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0444\u0440\u0430\u043d\u043a\u043e-\u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043d\u0442\u0435\u0440\u0432\u0435\u043d\u0446\u0438\u044f \u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0443\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0438\u043d\u0442\u0435\u0440\u0432\u0435\u043d\u0446\u0438\u0438 \u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0443<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9F%D1%83%D1%8D%D0%B1%D0%BB%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u0443\u044d\u0431\u043b\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u0443\u044d\u0431\u043b\u0435<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0428\u0430\u0440\u043b\u044f \u0434\u0435 \u041b\u043e\u0440\u0430\u043d\u0441\u044c\u0435 \u0431\u044b\u043b\u0438 \u043f\u043e\u0431\u0435\u0436\u0434\u0435\u043d\u044b \u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B0%D0%B3%D0%BE%D1%81%D0%B0,_%D0%98%D0%B3%D0%BD%D0%B0%D1%81%D0%B8%D0%BE\" title=\"\u0421\u0430\u0440\u0430\u0433\u043e\u0441\u0430, \u0418\u0433\u043d\u0430\u0441\u0438\u043e\">\u0418\u0433\u043d\u0430\u0441\u0438\u043e \u0421\u0430\u0440\u0430\u0433\u043e\u0441\u044b<\/a>. \u0412 \u0447\u0435\u0441\u0442\u044c \u044d\u0442\u043e\u0433\u043e \u0441\u043e\u0431\u044b\u0442\u0438\u044f \u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0435 \u0438 \u0421\u0428\u0410 \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e \u043e\u0442\u043c\u0435\u0447\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/5_%D0%BC%D0%B0%D1%8F_(%D0%BC%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%B0%D0%B7%D0%B4%D0%BD%D0%B8%D0%BA)\" class=\"mw-redirect\" title=\"5 \u043c\u0430\u044f (\u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a)\">5 \u043c\u0430\u044f (\u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a)<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1873_%D0%B3%D0%BE%D0%B4\" title=\"1873 \u0433\u043e\u0434\">1873<\/a>&#160;\u2014 \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D0%B0%D0%BD%D0%B4%D0%B8%D0%BD%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%B0%D0%BB%D1%8E%D1%82%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" class=\"mw-redirect\" title=\"\u0421\u043a\u0430\u043d\u0434\u0438\u043d\u0430\u0432\u0441\u043a\u0438\u0439 \u0432\u0430\u043b\u044e\u0442\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\">\u0421\u043a\u0430\u043d\u0434\u0438\u043d\u0430\u0432\u0441\u043a\u0438\u0439 \u0432\u0430\u043b\u044e\u0442\u043d\u044b\u0439 \u0441\u043e\u044e\u0437<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u043d\u044b\u0439 \u0437\u0430\u043b Music Hall (\u0441\u0435\u0439\u0447\u0430\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BD%D0%B5%D0%B3%D0%B8-%D1%85%D0%BE%D0%BB%D0%BB\" title=\"\u041a\u0430\u0440\u043d\u0435\u0433\u0438-\u0445\u043e\u043b\u043b\">\u041a\u0430\u0440\u043d\u0435\u0433\u0438-\u0445\u043e\u043b\u043b<\/a>); <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D1%91%D1%80\" title=\"\u0414\u0438\u0440\u0438\u0436\u0451\u0440\">\u0434\u0438\u0440\u0438\u0436\u0451\u0440\u043e\u043c<\/a> \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u0430 \u043d\u0430 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%B9%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9F%D1%91%D1%82%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0427\u0430\u0439\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u041f\u0451\u0442\u0440 \u0418\u043b\u044c\u0438\u0447\">\u041f.&#160;\u0418.&#160;\u0427\u0430\u0439\u043a\u043e\u0432\u0441\u043a\u0438\u0439<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1912\" title=\"\u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1912\">V \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440<\/a>, \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u044f<\/a>), \u0433\u0434\u0435 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0431\u044b\u043b\u0438 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u044b \u0441\u0442\u0430\u0432\u0448\u0438\u0435 \u043f\u043e\u0442\u043e\u043c \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u043c\u0438 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u0438 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u0438 \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u044f \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440. \u0421\u0430\u043c\u0438 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b\u0438 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u0434\u0432\u0443\u0445 \u0441 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u043e\u0439 \u043c\u0435\u0441\u044f\u0446\u0435\u0432, \u0438 \u043d\u0430\u0438\u043b\u0443\u0447\u0448\u0438\u0445 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u0434\u043e\u0431\u0438\u043b\u0438\u0441\u044c \u0445\u043e\u0437\u044f\u0435\u0432\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043b\u0438 \u043f\u043e 24 \u0437\u043e\u043b\u043e\u0442\u044b\u0435 \u0438 \u0441\u0435\u0440\u0435\u0431\u0440\u044f\u043d\u044b\u0435 \u043c\u0435\u0434\u0430\u043b\u0438 \u0438 17 \u0431\u0440\u043e\u043d\u0437\u043e\u0432\u044b\u0445.<\/li><li>\u0412\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0433\u0430\u0437\u0435\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B4%D0%B0_(%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0)\" title=\"\u041f\u0440\u0430\u0432\u0434\u0430 (\u0433\u0430\u0437\u0435\u0442\u0430)\">\u00ab\u041f\u0440\u0430\u0432\u0434\u0430\u00bb<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432<\/a> \u0441 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0432\u0435\u0440\u043d\u0443\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%BB%D1%8E%D1%80%D0%BE%D0%B2%D1%86%D1%8B\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u043b\u044e\u0440\u043e\u0432\u0446\u044b\">\u043f\u0435\u0442\u043b\u044e\u0440\u043e\u0432\u0446\u044b<\/a>. \u0413\u0440\u0443\u043f\u043f\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B4%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u0420\u0430\u0434\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0420\u0430\u0434\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>, \u0431\u044b\u0432\u0448\u0438\u0445 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u043e\u0432, \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043d\u044b\u0445 \u0432 \u0441\u043b\u0443\u0436\u0435\u043d\u0438\u0438, \u0437\u0430\u044f\u0432\u0438\u043b\u0430, \u0447\u0442\u043e \u0432\u0441\u0435 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u044b\u0435 \u0435\u043f\u0438\u0441\u043a\u043e\u043f\u044b \u043d\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u0435&#160;\u2014 \u0432\u0440\u0430\u0433\u0438 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430, \u0442\u0430\u043a \u043a\u0430\u043a \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u044e\u0442 \u0432 \u043e\u0431\u0449\u0435\u043d\u0438\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8_%D0%B2%D1%81%D0%B5%D1%8F_%D0%A0%D1%83%D1%81%D0%B8\" title=\"\u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0438 \u0432\u0441\u0435\u044f \u0420\u0443\u0441\u0438\">\u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u043e\u043c \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%BE%D0%BD_(%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u0422\u0438\u0445\u043e\u043d (\u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439)\">\u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u0435\u043c \u0422\u0438\u0445\u043e\u043d\u043e\u043c<\/a>. \u0420\u0430\u0434\u0430 \u043d\u0430 \u0441\u0432\u043e\u0435\u043c \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u0432\u044b\u043d\u0435\u0441\u043b\u0430 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%B2%D1%82%D0%BE%D0%BA%D0%B5%D1%84%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u0430\u0432\u0442\u043e\u043a\u0435\u0444\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438<\/a>&#160;\u2014 \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0439, \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0439 \u043d\u0438 \u043e\u0442 \u043a\u0430\u043a\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85%D0%B0%D1%82\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430\u0442\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430\u0442\u0430<\/a>.<\/li><li>\u0412 \u041f\u0430\u0440\u0438\u0436\u0435 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c, \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u043c, \u042f\u043f\u043e\u043d\u0441\u043a\u0438\u043c, \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0438 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430\u043c\u0438 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041a\u0440\u0435\u0441\u0442\u0430 \u0431\u044b\u043b \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0430\u043a\u0442 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u00ab\u041b\u0438\u0433\u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041a\u0440\u0435\u0441\u0442\u0430\u00bb (\u0412 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 1983 \u0433\u043e\u0434\u0430 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0430 \u0432 \u041b\u0438\u0433\u0443 \u043e\u0431\u0449\u0435\u0441\u0442\u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041a\u0440\u0435\u0441\u0442\u0430 \u0438 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041f\u043e\u043b\u0443\u043c\u0435\u0441\u044f\u0446\u0430, \u0441 \u043d\u043e\u044f\u0431\u0440\u044f 1991 \u0433\u043e\u0434\u0430&#160;\u2014 \u00ab\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u043e\u0431\u0449\u0435\u0441\u0442\u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041a\u0440\u0435\u0441\u0442\u0430 \u0438 \u041a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u041f\u043e\u043b\u0443\u043c\u0435\u0441\u044f\u0446\u0430\u00bb, \u0448\u0442\u0430\u0431-\u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0416\u0435\u043d\u0435\u0432\u0435).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u0434\u0443\u0445\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Chanel_No._5\" title=\"Chanel No. 5\">Chanel No. 5<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D1%81%D0%BE%D0%BC%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%B4%D0%B0\" title=\"\u041a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u0434\u0430\">\u00ab\u041a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u043f\u0440\u0430\u0432\u0434\u0435\u00bb<\/a> \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u044d\u0442\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412. \u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u00ab\u0427\u0435\u0442\u044b\u0440\u0451\u0445\u044d\u0442\u0430\u0436\u043d\u0430\u044f \u0445\u0430\u043b\u0442\u0443\u0440\u0430\u00bb.<\/li><li>\u0412 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u043a\u0435 \u0414\u0435\u0439\u0442\u043e\u043d (\u0448\u0442. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BD%D0%BD%D0%B5%D1%81%D1%81%D0%B8\" title=\"\u0422\u0435\u043d\u043d\u0435\u0441\u0441\u0438\">\u0422\u0435\u043d\u043d\u0435\u0441\u0441\u0438<\/a>) \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d 24-\u043b\u0435\u0442\u043d\u0438\u0439 \u0448\u043a\u043e\u043b\u044c\u043d\u044b\u0439 \u0443\u0447\u0438\u0442\u0435\u043b\u044c \u0414\u0436\u043e\u043d \u0421\u043a\u043e\u0443\u043f\u0441 (John Scopes), \u043e\u0441\u043c\u0435\u043b\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u043f\u0440\u0435\u043f\u043e\u0434\u0430\u0432\u0430\u0442\u044c \u0437\u0430\u043f\u0440\u0435\u0449\u0451\u043d\u043d\u0443\u044e \u0437\u0430\u043a\u043e\u043d\u0430\u043c\u0438 \u0448\u0442\u0430\u0442\u0430 \u044d\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u0442\u0435\u043e\u0440\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%80%D0%B2%D0%B8%D0%BD,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" class=\"mw-redirect\" title=\"\u0414\u0430\u0440\u0432\u0438\u043d, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0427\u0430\u0440\u043b\u044c\u0437\u0430 \u0414\u0430\u0440\u0432\u0438\u043d\u0430<\/a>. \u0421\u0443\u0434\u0435\u0431\u043d\u044b\u0439 \u043f\u0440\u043e\u0446\u0435\u0441\u0441, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u0447\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u043c\u0435\u0441\u044f\u0446\u0430, \u0431\u044b\u043b \u043e\u043a\u0440\u0435\u0449\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D0%B5%D0%B7%D1%8C%D1%8F%D0%BD%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%86%D0%B5%D1%81%D1%81\" title=\"\u041e\u0431\u0435\u0437\u044c\u044f\u043d\u0438\u0439 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\">\u00ab\u041e\u0431\u0435\u0437\u044c\u044f\u043d\u044c\u0438\u043c\u00bb<\/a> \u0438 \u043f\u0440\u0438\u0432\u043b\u0451\u043a \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u0432\u0441\u0435\u0433\u043e \u043c\u0438\u0440\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0412 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0414\u043d\u0451\u043c \u043f\u0435\u0447\u0430\u0442\u0438 \u043d\u0430 \u0422\u0432\u0435\u0440\u0441\u043a\u043e\u043c \u0431\u0443\u043b\u044c\u0432\u0430\u0440\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u043d\u0438\u0436\u043d\u044b\u0439 \u0431\u0430\u0437\u0430\u0440, \u0441\u0442\u0430\u0432\u0448\u0438\u0439 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%93%D0%AD%D0%A1\" title=\"\u0412\u043e\u043b\u0445\u043e\u0432\u0441\u043a\u0430\u044f \u0413\u042d\u0421\">\u0412\u043e\u043b\u0445\u043e\u0432\u0441\u043a\u043e\u0439 \u0413\u042d\u0421<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0443\u0441\u043a \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D1%82%D0%BE%D0%BA%D0%B0\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u0442\u043e\u0440 \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u0442\u043e\u043a\u0430\">\u0433\u0435\u043d\u0435\u0440\u0430\u0442\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0446\u0435\u043b\u044c\u043d\u043e\u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0442\u0440\u0451\u0445\u0434