%D0%BE%D0%BB%D0%B8\" title=\"\u041c\u0430\u0440\u0448 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0432\u043e\u043b\u0438\">\u041c\u0430\u0440\u0448 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0432\u043e\u043b\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u044b \u043a\u0430\u0440\u0442\u043e\u0447\u043a\u0438 \u043d\u0430 \u0441\u0430\u0445\u0430\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u041e\u043a\u043e\u043d\u0447\u0435\u043d\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043a\u0440\u0443\u043f\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430 \u0446\u0432\u0435\u0442\u043d\u043e\u0439 \u043c\u0435\u0442\u0430\u043b\u043b\u0443\u0440\u0433\u0438\u0438 \u0421\u0421\u0421\u0420&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D1%81%D0%BA-%D0%A3%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D0%B0%D0%BB%D0%BB%D1%83%D1%80%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u041a\u0430\u043c\u0435\u043d\u0441\u043a-\u0423\u0440\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0430\u043b\u043b\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0437\u0430\u0432\u043e\u0434\">\u041a\u0430\u043c\u0435\u043d\u0441\u043a-\u0423\u0440\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0430\u043b\u043b\u0443\u0440\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430 (\u041a\u0423\u041c\u0417)<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li>\u041a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u0438<\/a>.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B6%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_(1945)\" title=\"\u041f\u0440\u0430\u0436\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 (1945)\">\u041f\u0440\u0430\u0436\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f<\/a>, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0447\u0435\u0448\u0441\u043a\u0438\u043c\u0438 \u043f\u0430\u0442\u0440\u0438\u043e\u0442\u0430\u043c\u0438, \u0438 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043d\u043d\u043e\u0435 1-\u0439 \u043f\u0435\u0445\u043e\u0442\u043d\u043e\u0439 \u0434\u0438\u0432\u0438\u0437\u0438\u0435\u0439 \u0412\u0421 \u041a\u041e\u041d\u0420.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u044b \u043d\u0430 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\u0435 \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0430 \u043d\u043e\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0424\u0440\u0430\u043d\u0446\u0438\u0438\">\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u0414\u043e\u043c \u043e\u0431\u043e\u0440\u043e\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%9E%D0%A1%D0%90%D0%90%D0%A4\" title=\"\u0414\u041e\u0421\u0410\u0410\u0424\">\u0414\u041e\u0421\u0410\u0410\u0424<\/a> (\u0414\u043e\u0431\u0440\u043e\u0432\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0441\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0430\u0440\u043c\u0438\u0438, \u0430\u0432\u0438\u0430\u0446\u0438\u0438 \u0438 \u0444\u043b\u043e\u0442\u0443).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949_%D0%B3%D0%BE%D0%B4\" title=\"1949 \u0433\u043e\u0434\">1949<\/a>&#160;\u2014 \u0423\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0415\u0432\u0440\u043e\u043f\u044b\">\u0421\u043e\u0432\u0435\u0442\u0430 \u0415\u0432\u0440\u043e\u043f\u044b<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F\" title=\"\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f\">\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0438<\/a> (\u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043a \u0421\u043e\u0432\u0435\u0442\u0443 \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0441\u043b\u0430\u043d\u0434\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u044f<\/a>). \u0427\u043b\u0435\u043d\u044b \u0421\u043e\u0432\u0435\u0442\u0430 \u0437\u0430\u044f\u0432\u0438\u043b\u0438 \u043e \u0441\u0432\u043e\u0435\u0439 \u043f\u0440\u0438\u0432\u0435\u0440\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u0435 \u0438 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0443 \u0433\u043b\u0430\u0432\u0435\u043d\u0441\u0442\u0432\u0430 \u0437\u0430\u043a\u043e\u043d\u043e\u0432. \u041c\u0435\u0441\u0442\u043e\u043c \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043d\u0438\u044f \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0439 \u0421\u043e\u0432\u0435\u0442\u0430 \u0432\u044b\u0431\u0440\u0430\u043d \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B0%D1%81%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0442\u0440\u0430\u0441\u0431\u0443\u0440\u0433\">\u0421\u0442\u0440\u0430\u0441\u0431\u0443\u0440\u0433<\/a>. \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0430&#160;\u2014 \u041a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u0430\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u044f, \u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%83%D0%B4_%D0%BF%D0%BE_%D0%BF%D1%80%D0%B0%D0%B2%D0%B0%D0%BC_%D1%87%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u0443\u0434 \u043f\u043e \u043f\u0440\u0430\u0432\u0430\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430\">\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u0443\u0434 \u043f\u043e \u043f\u0440\u0430\u0432\u0430\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430<\/a>. \u041e\u0442\u043c\u0435\u0447\u0430\u0435\u0442\u0441\u044f \u043a\u0430\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B\" title=\"\u0414\u0435\u043d\u044c \u0415\u0432\u0440\u043e\u043f\u044b\">\u0414\u0435\u043d\u044c \u0415\u0432\u0440\u043e\u043f\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043f\u043e\u043a\u0430\u0437\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Nimrod\" title=\"Nimrod\">\u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440<\/a>, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0439 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BF%D1%8C%D1%8E%D1%82%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%B8%D0%B3%D1%80%D0%B0\" title=\"\u041a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u0430\u044f \u0438\u0433\u0440\u0430\">\u0438\u0433\u0440\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\">\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0435<\/a> \u043a \u0432\u043b\u0430\u0441\u0442\u0438 \u043f\u0440\u0438\u0448\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B5%D1%81%D1%81%D0%BD%D0%B5%D1%80,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4%D0%BE\" title=\"\u0421\u0442\u0440\u0435\u0441\u0441\u043d\u0435\u0440, \u0410\u043b\u044c\u0444\u0440\u0435\u0434\u043e\">\u0410\u043b\u044c\u0444\u0440\u0435\u0434\u043e \u0421\u0442\u0440\u0435\u0441\u0441\u043d\u0435\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043c\u0438\u0440\u0430 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B7%D1%8E%D0%B4%D0%BE\" title=\"\u0414\u0437\u044e\u0434\u043e\">\u0434\u0437\u044e\u0434\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u0424\u0438\u043b\u043e\u0441\u043e\u0444 \u0438 \u0431\u043e\u0433\u043e\u0441\u043b\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0424\u043b\u043e\u0440\u0435\u043d\u0441\u043a\u0438\u0439, \u041f\u0430\u0432\u0435\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041f\u0430\u0432\u0435\u043b \u0424\u043b\u043e\u0440\u0435\u043d\u0441\u043a\u0438\u0439<\/a> \u0440\u0435\u0430\u0431\u0438\u043b\u0438\u0442\u0438\u0440\u043e\u0432\u0430\u043d \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0433\u043e \u0441\u0443\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u0443\u0431\u043e\u0440\u0431\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u043a\u043e\u0440\u0430\u0431\u043b\u0435 \u00ab\u041c\u0435\u0440\u043a\u0443\u0440\u0438\u0439\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%80%D0%BA%D1%83%D1%80%D0%B8%D0%B9-%D0%A0%D0%B5%D0%B4%D1%81%D1%82%D0%BE%D1%83%D0%BD-3\" title=\"\u041c\u0435\u0440\u043a\u0443\u0440\u0438\u0439-\u0420\u0435\u0434\u0441\u0442\u043e\u0443\u043d-3\">\u041c\u0420-3<\/a>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BF%D0%B0%D1%80%D0%B4,_%D0%90%D0%BB%D0%B0%D0%BD\" title=\"\u0428\u0435\u043f\u0430\u0440\u0434, \u0410\u043b\u0430\u043d\">\u0410\u043b