e\u044f\u043b\u043e\u0441\u044c \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%85%D0%B0%D1%80%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0430\u0445\u0430\u0440\u043e\u0432, \u0410\u043d\u0434\u0440\u0435\u0439 \u0414\u043c\u0438\u0442\u0440\u0438\u0435\u0432\u0438\u0447\">\u0430\u043a\u0430\u0434\u0435\u043c\u0438\u043a\u0443 \u0421\u0430\u0445\u0430\u0440\u043e\u0432\u0443<\/a>. \u041d\u0430 \u043e\u0434\u043d\u043e\u0438\u043c\u0451\u043d\u043d\u043e\u0439 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u0431\u044b\u043b\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 3-\u043c\u0435\u0442\u0440\u043e\u0432\u0430\u044f \u0431\u0440\u043e\u043d\u0437\u043e\u0432\u0430\u044f \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u0443\u0440\u0430 \u0440\u0430\u0431\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%B2%D0%BE%D0%BD_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0430\u0437\u0430\u0440\u0435\u0432, \u041b\u0435\u0432\u043e\u043d \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u041b\u0435\u0432\u043e\u043d\u0430 \u041b\u0430\u0437\u0430\u0440\u0435\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"\u0422\u0430\u0439\u0432\u0430\u043d\u044c\">\u0422\u0430\u0439\u0432\u0430\u043d\u044c\u0441\u043a\u0438\u0439<\/a> \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u043f\u0440\u0438\u043d\u044f\u043b \u043d\u043e\u0432\u044b\u0439 \u0437\u0430\u043a\u043e\u043d \u043e \u043f\u0438\u0441\u044c\u043c\u0435\u043d\u043d\u043e\u0441\u0442\u0438. \u0422\u0435\u043f\u0435\u0440\u044c \u0432\u0441\u0435 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u043f\u0438\u0441\u0430\u0442\u044c\u0441\u044f \u0441\u043b\u0435\u0432\u0430 \u043d\u0430\u043f\u0440\u0430\u0432\u043e. \u0421\u0435\u0439\u0447\u0430\u0441 \u043d\u0430 \u0422\u0430\u0439\u0432\u0430\u043d\u0435 \u043f\u0438\u0448\u0443\u0442 \u043b\u0438\u0431\u043e \u0441\u043f\u0440\u0430\u0432\u0430 \u043d\u0430\u043b\u0435\u0432\u043e, \u043b\u0438\u0431\u043e \u0441\u0432\u0435\u0440\u0445\u0443 \u0432\u043d\u0438\u0437. \u041a\u0430\u043a \u043f\u043e\u044f\u0441\u043d\u0438\u043b \u0441\u043f\u0438\u043a\u0435\u0440 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430, \u0442\u0430\u043a\u043e\u0435 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435 \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441 \u0442\u0435\u043c, \u0447\u0442\u043e \u0432\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0435 \u0446\u0438\u0444\u0440\u044b \u0438 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0435 \u0441\u043b\u043e\u0432\u0430 \u0432 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0445 \u00ab\u0441\u0431\u0438\u0432\u0430\u044e\u0442 \u0441 \u0442\u043e\u043b\u043a\u0443\u00bb. \u041d\u043e\u0432\u043e\u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u043d\u0435 \u043a\u043e\u0441\u043d\u0443\u0442\u0441\u044f \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b. \u041f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u0438 \u0437\u0430\u043a\u043e\u043d\u0430 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u044e\u0442, \u0447\u0442\u043e \u0442\u0430\u043a\u0438\u0435 \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0435\u0449\u0451 \u0431\u043e\u043b\u0435\u0435 \u043e\u0441\u043b\u0430\u0431\u044f\u0442 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u043d\u044b\u043d\u0435\u0448\u043d\u0435\u0439 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005_%D0%B3%D0%BE%D0%B4\" title=\"2005 \u0433\u043e\u0434\">2005<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%9A%D0%BE%D0%BD%D0%B3%D0%BE\" title=\"\u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041a\u043e\u043d\u0433\u043e\">\u041a\u043e\u043d\u0433\u043e<\/a> \u0440\u0430\u0437\u0431\u0438\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-26\" title=\"\u0410\u043d-26\">\u0410\u043d-26<\/a>\u00bb, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 10 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u0412\u0441\u0435\u0433\u043e \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0431\u044b\u043b\u0438 11 \u0447\u0435\u043b\u043e\u0432\u0435\u043a: 5 \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430 \u0438 6 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432, \u043e\u0434\u0438\u043d \u0438\u0437 \u043d\u0438\u0445 \u0432\u044b\u0436\u0438\u043b.<\/li><\/ul><h2>"}